import React from 'react';
import picturelizard from '../picturelizard.svg';
import '../styles/App.css';
import { jsx, css } from '@emotion/react';
import styled from '@emotion/styled';

const h1Style = css({
  color: 'rgb(96, 32, 112)',
  backgroundColor: 'green',
  left: '7%'
});

export const H1 = css.h1(
  {
    color: 'darkgoldenrod',
    fontSize: 60
  },
  props => ({ color: props.color })
)

export const P = styled.p(
  {
    color: 'darkgreen',
    fontSize: 35
  },
  props => ({color: props.color})
)

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className='title'> Erik Martin Estevez</h1>
        <img src={picturelizard} className="Main-Pic" alt="picturelizard" />

      </header>
      <body>
      <p className='briefDescription'>
          My name is Erik and I am an international student from Spain that is currently doing a Computer Science Bachelor
          at Murdoch University.<br/><br/>
          Furthermore, I work in a Cafe in Fremantle as a waiter and also doing an internship at&nbsp;
          <a href='https://www.climateclever.org/'>ClimateClever</a> 
          &nbsp;during January
          and February.
        </p>
      </body>
    </div>
  );
}

export default App;
